package cn.jsi.buaa;

import java.util.HashMap;
import java.util.Iterator;

public class MiniWindow {
	char[] s1;
	char[] s2;
	int currentSum;
	int minv, mins;
	char missChar;
	boolean usedebug = false;
	HashMap<Character, Integer> vm = new HashMap<Character, Integer>();
	HashMap<Character, Integer> cm = new HashMap<Character, Integer>();
	HashMap<Character, Integer> nm = new HashMap<Character, Integer>();

	public String m1() {
		// find first window
		int p2 = step1();
		if (p2 == -1)
			return "";
		// debugNM();
		// find the starter
		int p1 = findStarter(-1, s1.length);
		while (p1 <= s1.length) {
			debugNM();
			if (usedebug)
				System.out.println("p1=" + p1 + " p2=" + p2);
			if (minv > p2 - p1) {
				mins = p1;
				minv = p2 - p1 + 1;
			}
			missChar = s1[p1];
			Integer value=nm.get(s1[p1]);
			nm.put(s1[p1], value-1);
			p1 = findStarter(p1, s1.length);
			if (p1 < 0 || p1 >= s1.length)
				return String.valueOf(s1, mins, minv);
			if (usedebug)
				System.out.println("starter back p1=" + p1 + " mssingchar="
						+ missChar+" charnumber="+nm.get(missChar) );
			
			boolean notmissing = judgeMissing(p1,p2);
			if (notmissing)
				continue;
			p2 = findEnder(p2);
			if (p2 < 0 || p2 >= s1.length)
				return String.valueOf(s1, mins, minv);
			if (usedebug)
				System.out.println("ender back");
		}
		return String.valueOf(s1, mins, minv);
	}

	private boolean judgeMissing(int p1,int p2) {
		Integer v1 = cm.get(missChar);
		Integer v2 = nm.get(missChar);
		if (usedebug)
		System.out.println("Comparing missingchar="+missChar+"  "+v2+" vs "+v1+" @"+p1+"~"+p2);
		if (v2>=v1)
			return true;
		else
			return false;
	}

	private int findEnder(int p2) {
		for (int i = p2 + 1; i < s1.length; i++) {
			Character key = s1[i];
			Integer j2 = nm.get(key);
			if (j2 == null)
				j2 = 0;
			nm.put(key, ++j2);
			if (key == missChar)
				return i;
		}
		return -1;
	}

	private int findStarter(int starter, int p2) {
		for (int i = starter + 1; i < p2; i++) {
			Character key = s1[i];
			Integer j3 = cm.get(key);
			Integer j2 = nm.get(key);
			//System.out.println("key="+key+"  j2="+j2+" j3="+j3);
			if (j3 == null)
				continue;
			// can't go any more
			if (j2-1 < j3) {
				return i;
			}
			j2--;
			nm.put(key, j2);
			
		}
		return -1;
	}

	private int step1() {
		int i = 0;
		for (; i < s1.length; i++) {
			// nm
			Integer j2 = nm.get(s1[i]);
			if (j2 == null)
				j2 = 0;
			nm.put(s1[i], j2 + 1);
			// vm
			Integer j = vm.get(s1[i]);
			if (j == null || j <= 0)
				continue;
			j--;
			vm.put(s1[i], j);
			currentSum--;
			if (currentSum <= 0)
				return i;
		}
		return -1;

	}

	public String minWindow(String S, String T) {
		s1 = S.toCharArray();
		s2 = T.toCharArray();
		debugs1();
		currentSum = s2.length;
		minv = s1.length;
		for (Character c : s2) {
			Integer i = vm.get(c);
			if (i == null)
				i = 0;
			vm.put(c, i + 1);
			cm.put(c, i + 1);
		}
		String res = m1();
		return res;
	}

	private void debugs1() {
		if (!usedebug)
			return;
		for (int i = 0; i < s1.length; i++)
			System.out.printf("%3d", i);
		System.out.println();
		for (int i = 0; i < s1.length; i++)
			System.out.printf("%3c", s1[i]);
		System.out.println();

	}

	private void debugNM() {
		if (!usedebug)
			return;
		Iterator<Character> it = nm.keySet().iterator();
		while (it.hasNext()) {
			Character key = it.next();
			System.out.println("key:" + key + " value:" + nm.get(key));
		}
	}

	public static void main(String[] args) {
		MiniWindow m = new MiniWindow();
		String s = "";
		// s=m.minWindow("xabx", "ab");
		// System.out.println("res="+s);
		// System.out.println("*******");
		// s=m.minWindow("xaabx", "aab");
		// System.out.println("res="+s);
		// System.out.println("*******");
		// s=m.minWindow("",
		// "aab");

		s = m.minWindow("bacbacaaaaaaabc", "baa");

	//	s = m.minWindow("xaxxxabxaxxabbbbaab", "baa");
		System.out.println("res=" + s);

		// String s=m.minWindow("xaxabaabx", "aab");
		// System.out.println("res="+s);
	}

}
